import styled, { createGlobalStyle } from 'styled-components';
import logo from '../../images/logo.png';

export const Nav = createGlobalStyle('div')`
        background-color: #F3A0A6;
        align-items: center;
        position: sticky;
        display: flex;
        z-index: 999;
        height: 149px;
        top: 0;
    div {
        img: src={logo}
        text-align: center;
        width: 83px;
        height: 86px;
        border-radius: 75px;
    }
`;
